Chanel Preston - The One Mile High Club

Added: March 21, 2011

Size:  770 Mb

Keiran is a high powered business man waiting in the pre-boarding area when he notices a gorgeous airline stewardess attending to some of the other passengers. Chanel makes the announcement that Keiran's flight has been delayed. Forced to wait overnight, Keiran decides that the stewardess will just have to find a way to help him pass the time.

